import { withStyles } from '@material-ui/core/styles';

import Terms from './Terms'


const styles = (theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
    padding: 0,
  },
  tabContainer: {
    margin: '2rem',
    paddignTom: '5rem',
  },
});

export default withStyles(styles)(Terms);
